import React from "react";

function Getstarted() {
    return (
        <div className="getStarted">
            <div className="in-getStarted">
                <div className="in-in-getStarted">
                    <h1>You vs. 249 applicants</h1>
                    <h4>
                        According to Glassdoor, every corporate job attracts 250
                        applicants on average. Gain an edge over these other
                        applicants by learning from previous interviewees.
                    </h4>
                    <div className="getstarted-btns">
                        <input type="text" placeholder="Enter your Email" />
                        <button type="submit">Get Started</button>
                    </div>
                </div>
            </div>
        </div>
    );
}
export default Getstarted;
